import styled from "@emotion/styled";

export const TimeInputButton = styled.button`
  width: 10rem;
  height: 4rem;
  border: none;
  margin-left: 26.5%;
  margin-top: 20rem;
  border-radius: 1rem;
  background-color: #d9d9d9;
`;
